import React from 'react';

import logo from '~/assets/logo.png';

export default function Login() {
  return (
    <>
      <img src={logo} alt="Razzo" />

      <form>
        <input type="email" placeholder="Email" />
        <input type="password" placeholder="Senha" />
      </form>
    </>
  );
}
